import React from "react";
import "./signup.css";

const SignUp = () => {
  return (
    <div className="singup">
      <form action="" className="signup_form">
        <div className="row">
          <div className="col-md-6">
            <label htmlFor="fname">
              First Name
              <input type="text" className="form-control" />
            </label>
          </div>

          <div className="col-md-6">
            <label htmlFor="fname">
              First Name
              <input type="text" className="form-control" />
            </label>
          </div>
        </div>
      </form>
    </div>
  );
};

export default SignUp;
